import React from "react";
import { Logo } from "../assets/logo.svg";
import styled from "styled-components";

export const LogoImage = styled.img`
  width: 150px;
  margin: 0.5rem 0;
`;

const ImageLogo = () => {
  <Logo src={Logo} alt="Osc Logo" />;
};

export default ImageLogo;
